#დავალება N3. დოკუმენტში კომენტარების გამოყენებით ქართული ენით ახსენით რა არის ტერმინალი და რისთვის ვიყენებთ.

#ტერმინალი-ტერმინალი არის გრაფა სადაც შეგვიძლია დავინახოთ ჩვენს მიერ დაწერილი კოდების და გაცემული ბრძანების შედეგები. ტერმინალი გვეხმარება დავინახოთ არის თუარა ჩვენს მიერ დაწერილი კოდი სწორი,ასევე შეცდომის დაშვების შემთხვევაში გვეუბნება რა სახის შეცდომა გვაქვს დაშვებული კოდის წერის დროს.